function App() {
  return (
    <div className="container">
      <div className = "container-fluid">
        <div className = "row">
          <div className = "col s12">Menu</div>
        </div>
        <div className = "row">
          <div className = "col s3"><StockList /></div>
          <div className = "col s9"><StockSingle /></div>
        </div>
        <div className = "row">
          <div className = "col s12"><StockForm /></div>
        </div>
      </div>
    </div>
  );
}

export default App;
